import { useState } from 'react';
import './Task.css'

const Task = ({title, author, body}) => {
    const [showDetails, setShowDetails] = useState(false)
    const onClick = () => {
        setShowDetails(true)
        console.log("hello")
    }
    
    return (
        <div className="task">
            <div className="collapse" onClick={onClick}>
                {showDetails ? <h2>{title}</h2>: null}
            </div>
        </div>
    );
}
 
export default Task;
